window.bookSummaryJSON = "<p><b>With the successful conclusion of the monster subjugation campaign, Eizo returns home with a new addition to the family—Lidy!</b></p> <p>However, his days of battling beasts aren't quite over. During a chance encounter with Samya's childhood friend, Jolanda, the family learns of another corrupted bear that's stalking around the Black Forest. Jolanda also mentions a tantalizing rumor about a magical knife, which Rike and Eizo are eager to investigate. Could this be a new product to add to Forge Eizo's lineup?</p> <p>Eizo also receives a new large-scale commission that will test his skills, along with some troublesome news—there are signs of a revolution brewing in the neighboring empire. Things go from bad to worse when Eizo finds out that the legendary mercenary Lightning Blade Helen has been taken prisoner by the empire! Can a humble blacksmith come to her rescue? And with so many irons in the fire, can Eizo still forge a quiet life?</p>"; 
